import React from "react";

const ConnectWallet = () => {
  return (
    <button
      style={{
        fontWeight: 500,
        background: "#e6f7ff",
        padding: "8px 36px",
        cursor: "pointer",
        border: "none",
        borderRadius: "10px",
        fontFamily: "IBM Plex Mono, monospace",
        fontSize: "16px",
        justifySelf: "flex-end",
        width: "14.375vw",
      }}
    >
      Connect Wallet
    </button>
  );
};

export default ConnectWallet;
